import React from "react";
import "./App.css";
import Header from './component/header/Header';

import PersonIcon from '@material-ui/icons/Person';
import ForumIcon from '@material-ui/icons/Forum';

function App() {
  return (
    <div className="app">
      <PersonIcon />
     <ForumIcon />
      <Header />
      <h1>Let us build Tnder app</h1>
    </div>
  );
}

export default App;
